import React, { useState } from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Button from '@mui/material/Button';

import {Formik,Form,Field} from 'formik'
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogActions from '@mui/material/DialogActions';
import IconButton from '@mui/material/IconButton';
import CloseIcon from '@mui/icons-material/Close';
import Typography from '@mui/material/Typography';
import InteviewPortal from './InteviewPortal';
import axios from 'axios';
//button/-----
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
    '& .MuiDialogContent-root': {
      padding: theme.spacing(2),
    },
    '& .MuiDialogActions-root': {
      padding: theme.spacing(1),
    },
  }));


const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: '#1976d2',
      color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
    },
  }));
  
  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
      border: 0,
    },
  }));
  
  function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }
  
  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];
  
const currencies = [
    {
      value: 'USD',
      label: '$',
    },
    {
      value: 'EUR',
      label: '€',
    },
    {
      value: 'BTC',
      label: '฿',
    },
    {
      value: 'JPY',
      label: '¥',
    },
  ];
const SubCatagary = () => {
     const [open, setOpen] = React.useState(false);
    
        const handleClickOpen = () => {
          setOpen(true);
        };
        const handleClose = () => {
          setOpen(false);
        };
        const [ini,setIni]=usestate({
          subCategoryname:'',
          categoryID:''

        })
        const [list,setList]=useState([])
        const handleSubmit =(values,{resetorm})=>{
          axios.post('https://interviewback-ucb4.onrender.com/subcatagory/create',values,{
              headers :{
                Authorization
              }
          })
        }
        function dataView(){
          axios.get('http://localhost:5500/subcatagory/',{
            headers:{
              Authorization:"eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0Mjc5Njg3OX0.VhjRg_oGm9skgXMpeoVr5BzXF_1CYCdgaGYn8WCL_aM"
            }
          })
          .then((res)=>{
            console.console.log(res.data.data);
            setList(res.data.data)
            
          })
          .catch((err)=>{
            console.log(err);
          })
        }
  return (
    <>
    <InteviewPortal>
    <Box sx={{width:'100%',display:'flex',flexWrap:{lg:'no-wrap',md:'wrap',sm:'wrap',xs:'wrap'}}}>
    <Box
      component="form"
      sx={{    width: {lg:'80% ',md:'100%',sm:'100%',xs:'100%'}}}
   
      noValidate
      autoComplete="off"
   
    >
      <div>
        <TextField
          id="outlined-select-currency"
          select
          label="Search Catagary"
          sx={{width:'100%'}}
        >
          {currencies.map((option) => (
            <MenuItem key={option.value} value={option.value}>
              {option.label}
            </MenuItem>
          ))}
        </TextField>
       
      </div>
 
    </Box>
    {/* button add catagary------------------------------------------------ */}
    <Box sx={{  width: {lg:'20% ',md:'100%',sm:'100%',xs:'100%'},justifyContent:'center',display:'flex',padding: '10px 0px ' }}>
    <React.Fragment>
      <Button  sx={{backgroundColor:'#1976d2',color:'white',width:'100%'}}variant="outlined" onClick={handleClickOpen}>
       ADD  SUB-CATAGARY
      </Button>
      <BootstrapDialog
        onClose={handleClose}
        aria-labelledby="customized-dialog-title"
        open={open}
      >
        <DialogTitle sx={{ m: 0, p: 2 }} id="customized-dialog-title">
         Add Catagary
        </DialogTitle>

        
        <IconButton
      
          aria-label="close"
          onClick={handleClose}
          sx={(theme) => ({
            position: 'absolute',
            right: 8,
            top: 8,
            color: theme.palette.grey[500],
          })}
        >
          <CloseIcon />
        </IconButton>
        <Formik
        enableReinitialize
        initialValues={ini}
        onSubmit={handleSubmit}>
        <Form>
        <DialogContent dividers sx={{display:'flex'}}>
                <Field as={TextField} name="subCategoryname" label='subcategory'></Field>
                <Field as={TextField} name="categoryID" label='category'></Field>
            
      
        <DialogActions>
          <Button   sx={{backgroundColor:'#1976d2',color:'white'}}autoFocus onClick={handleClose}>
            Submit
          </Button>
        </DialogActions>
        </DialogContent>
        </Form>
         </Formik>
      </BootstrapDialog>
    </React.Fragment>
    </Box>
    </Box>

    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 700, }} aria-label="customized table">
        <TableHead >
          <TableRow >
            <StyledTableCell >No.</StyledTableCell>
            <StyledTableCell align="left">Sub-Catagary Name</StyledTableCell>
            <StyledTableCell align="left">Catagary Name</StyledTableCell>
            <StyledTableCell align="right">Status</StyledTableCell>
            <StyledTableCell align="right">Delete</StyledTableCell>
            <StyledTableCell align="right">Update</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row">
                {row.name}
              </StyledTableCell>
              <StyledTableCell align="left">{row.calories}</StyledTableCell>
              <StyledTableCell align="left">{row.calories}</StyledTableCell>
              <StyledTableCell align="right">{row.fat}</StyledTableCell>
              <StyledTableCell align="right">{row.carbs}</StyledTableCell>
              <StyledTableCell align="right">{row.protein}</StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </InteviewPortal>
   </>
  )
}

export default SubCatagary
